import React from "react";

function Landing() {
  const styles = {
    container: {
  display: "flex",
  fontFamily: "'Segoe UI', sans-serif",
  background: "linear-gradient(120deg, #fafaf9 60%, #fef3c7 100%)", 
  // light cream with soft yellow
  minHeight: "100vh",
},
    // Sidebar
    sidebar: {
      width: "220px",
      background: "#fff",
      padding: "24px",
      boxShadow: "2px 0 12px rgba(0,0,0,0.07)",
      display: "flex",
      flexDirection: "column",
      justifyContent: "space-between",
      borderTopRightRadius: "18px",
      borderBottomRightRadius: "18px",
    },
    logoBox: {
      textAlign: "center",
      marginBottom: "40px",
    },
    logo: {
      fontSize: "28px",
      fontWeight: "bold",
      color: "#6366f1",
      letterSpacing: "2px",
      marginBottom: "4px",
    },
    menu: {
      listStyle: "none",
      padding: 0,
      margin: 0,
    },
    menuItem: {
      display: "flex",
      alignItems: "center",
      gap: "10px",
      padding: "14px 0",
      color: "#22223b",
      fontWeight: "500",
      textDecoration: "none",
      cursor: "pointer",
      borderRadius: "8px",
      transition: "background 0.2s",
    },
    helpBox: {
      marginTop: "40px",
      padding: "18px",
      background: "#eef2ff",
      borderRadius: "14px",
      textAlign: "center",
      fontSize: "15px",
      color: "#6366f1",
      boxShadow: "0 2px 8px rgba(99,102,241,0.08)",
    },

    // Main content
    main: {
      flex: 1,
      padding: "36px",
      display: "grid",
      gridTemplateColumns: "2fr 1fr",
      gap: "36px",
    },
    section: {
      background: "#fff",
      padding: "28px",
      borderRadius: "16px",
      boxShadow: "0 4px 18px rgba(99,102,241,0.07)",
      marginBottom: "24px",
      minWidth: "0",
    },
    sectionTitle: {
      fontSize: "22px",
      fontWeight: "bold",
      marginBottom: "18px",
      color: "#6366f1",
      letterSpacing: "1px",
    },
    productCard: {
      display: "flex",
      gap: "24px",
      alignItems: "center",
      flexWrap: "wrap",
    },
    productImg: {
      width: "200px",
      height: "160px",
      objectFit: "cover",
      borderRadius: "14px",
      boxShadow: "0 2px 8px rgba(99,102,241,0.08)",
      background: "#f1f5f9",
      border: "2px solid #e0e7ff",
    },
    productInfo: {
      flex: 1,
      minWidth: "180px",
    },
    productName: {
      fontSize: "19px",
      fontWeight: "bold",
      color: "#22223b",
      marginBottom: "4px",
    },
    productDesc: {
      fontSize: "15px",
      color: "#475569",
      margin: "10px 0",
    },
    productPrice: {
      color: "#16a34a",
      fontWeight: "bold",
      fontSize: "17px",
      marginBottom: "12px",
    },
    buttons: {
      display: "flex",
      gap: "12px",
      justifyContent: "center",
      marginTop: "10px",
    },
    btn: {
      padding: "10px 22px",
      borderRadius: "10px",
      border: "none",
      cursor: "pointer",
      fontWeight: "500",
      fontSize: "15px",
      boxShadow: "0 2px 8px rgba(99,102,241,0.07)",
      transition: "background 0.2s, transform 0.2s",
    },
    cartBtn: {
      background: "linear-gradient(90deg, #22c55e 70%, #16a34a 100%)",
      color: "#fff",
    },
    buyBtn: {
      background: "linear-gradient(90deg, #6366f1 70%, #0ea5e9 100%)",
      color: "#fff",
    },
    // Right column cards
    rightCard: {
      background: "#fff",
      borderRadius: "14px",
      padding: "18px",
      boxShadow: "0 4px 18px rgba(99,102,241,0.07)",
      marginBottom: "24px",
      textAlign: "center",
    },
    rightImg: {
      width: "100%",
      height: "120px",
      objectFit: "cover",
      borderRadius: "10px",
      marginBottom: "12px",
      background: "#f1f5f9",
      border: "2px solid #e0e7ff",
    },
  };

  // Button hover effect (inline style workaround)
  const handleMouseOver = (e) => {
    e.target.style.transform = "scale(1.05)";
    e.target.style.filter = "brightness(1.08)";
  };
  const handleMouseOut = (e) => {
    e.target.style.transform = "scale(1)";
    e.target.style.filter = "brightness(1)";
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <aside style={styles.sidebar}>
        <div>
          <div style={styles.logoBox}>
            <div style={styles.logo}>HypeCart</div>
            <p style={{ fontSize: "13px", color: "#6366f1" }}>
              Where trends meet shopping
            </p>
          </div>
          <ul style={styles.menu}>
            {["Home", "Product", "Cart", "About us", "Contact"].map((item) => (
              <li
                key={item}
                style={styles.menuItem}
                onMouseOver={e => (e.currentTarget.style.background = "#eef2ff")}
                onMouseOut={e => (e.currentTarget.style.background = "transparent")}
              >
                <span>ðŸ“Œ</span> {item}
              </li>
            ))}
          </ul>
        </div>
        <div style={styles.helpBox}>
          <p>Need Help?</p>
          <button
            style={{ ...styles.btn, ...styles.buyBtn }}
            onMouseOver={handleMouseOver}
            onMouseOut={handleMouseOut}
          >
            Customer Service
          </button>
        </div>
      </aside>

      {/* Main Content */}
      <main style={styles.main}>
        <div>
          {/* Latest Release */}
          <div style={styles.section}>
            <h3 style={styles.sectionTitle}>Latest Release</h3>
            <div style={styles.productCard}>
              <img
                src="/images/latest gpu.png"
                alt="GPU"
                style={styles.productImg}
              />
              <div style={styles.productInfo}>
                <p style={styles.productName}>Samsung 75 inc Smart TV</p>
                <p style={styles.productDesc}>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                </p>
                <p style={styles.productPrice}>â‚±50,000</p>
                <div style={styles.buttons}>
                  <button
                    style={{ ...styles.btn, ...styles.cartBtn }}
                    onMouseOver={handleMouseOver}
                    onMouseOut={handleMouseOut}
                  >
                    Add to Cart
                  </button>
                  <button
                    style={{ ...styles.btn, ...styles.buyBtn }}
                    onMouseOver={handleMouseOver}
                    onMouseOut={handleMouseOut}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>
          </div>

          {/* Must Have Item */}
          <div style={styles.section}>
            <h3 style={styles.sectionTitle}>Must Have Item</h3>
            <div style={styles.productCard}>
              <img
                src="/images/table.jfif"
                alt="Table"
                style={styles.productImg}
              />
              <div style={styles.productInfo}>
                <p style={styles.productName}>Minimalist Wooden Table</p>
                <p style={styles.productDesc}>
                  Modern design, premium build, perfect for every home.
                </p>
                <p style={styles.productPrice}>â‚±1,300</p>
                <div style={styles.buttons}>
                  <button
                    style={{ ...styles.btn, ...styles.cartBtn }}
                    onMouseOver={handleMouseOver}
                    onMouseOut={handleMouseOut}
                  >
                    Add to Cart
                  </button>
                  <button
                    style={{ ...styles.btn, ...styles.buyBtn }}
                    onMouseOver={handleMouseOver}
                    onMouseOut={handleMouseOut}
                  >
                    Buy Now
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Right Column */}
        <div>
          <div style={styles.rightCard}>
            <img
              src="/images/sofa.jpeg"
